var express = require('express');
const UserModel = require('../models.js').User;


//Segundo Enrutador:
const usuarioRoutesDos = express.Router();
//get example2 params
usuarioRoutesDos.get('/:namer', async(req,res)=>{
  const {name} = req.params.namer;
  console.log(name);
  const user = await UserModel.find({name:name}).exec();
  if (!user){
    return res.status(404).send();
  }
  return res.json(user);
});

export default usuarioRoutesDos;
